import React from 'react'
import './Sidebar.'

const sideDrawer = props =>(
        <nav className="side-drawer">
            <ul>
                <li><a href="/">Connexion</a></li> 
                <li><a href="/">Favoris</a></li> 
            </ul>
        </nav>
);

export default sideDrawer;
